import chunk from "chunk"

export default function Gallery(props) {
  return (
    <div>
    	{chunk(props.images.map(i => i.replace("public/", "")), 5).map(
    		(column) => (
    			<div className="flex-auto">
	    			<img src={column[0]} className="w-1/5"/>
	    			<img src={column[1]} className="w-1/5"/>
	    			<img src={column[2]} className="w-1/5"/>
	    			<img src={column[3]} className="w-1/5"/>
	    			<img src={column[4]} className="w-1/5"/>
    			</div>
    		)
    	)
		}
    </div>
  )
}
